import React from 'react';
import { Container, Form, Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import "./loginform.css"


const LoginForm = () => {
  return (
    <Container className="d-flex justify-content-center align-items-center" style={{display:"flex",justifyContent:"center",height:"80vh"}}>
        <Form className='login-form'>
            <Form.Group>
            <Form.Label>Email address</Form.Label>
            <Form.Control type="email" placeholder="Enter email"/>
            </Form.Group>

            <Form.Group style={{paddingBottom:"10px"}}>
            <Form.Label>Password</Form.Label>
            <Form.Control type="password" placeholder="Enter Password" />
            </Form.Group>

            <Button variant="primary" type="submit" className='login'>
            LOGIN
            </Button>
        </Form>
    </Container>
  );
};

export default LoginForm;
